import Link from 'next/link'
import Layout from '../components/layout'

const mockIndex = [
  {
    title: 'The Federalist Papers',
    url: '/docs/the-federalist-papers',
  },
  {
    title: 'The Anti-federalist Papers',
    url: '/docs/the-anti-federalist-papers',
  }
];

const DocsIndex = mockIndex.map((mockDoc, index) => (
  <li key="{index}">
    <Link href="{mockDoc.link}">
      <a>{mockDoc.title}</a>
    </Link>
  </li>
));

const IndexPage = () => (
  <Layout>
    <ul>
      {DocsIndex}
    </ul>
  </Layout>
)

export default IndexPage
